// Stencil<uint16_t, (outImgSizeX + 4), (outImgSizeY + 4)> &hw_input_stencil = arg_0;
  prg.add_input("hw_input_stencil");
  prg.buffer_port_widths["hw_input_stencil"] = 16;
int32_t outImgSizeX = arg_1;
